import React from 'react'
import styled from 'styled-components'
import {gray} from 'open-color'

const Wrapper = styled.div`
    display: flex;
    justify-content: space-around;

    height: 50px;

    border-top: 1px solid ${gray[1]}
    font-size: 1.2rem;
    div:nth-child(1){
        background: red;
    }
    div:nth-child(2){
        background: blue;
    }
    div:nth-child(3){
        background: yellow;
    }
`


function BottomBar () {
    return(
        <Wrapper>
            <div>1</div>
            <div>2</div>
            <div>3</div>
        </Wrapper>
    )
}

export default BottomBar
